      SELECT ALL - col1 + - col1 AS col1 FROM tab1 (FORMAT parquet) WHERE - ( - col2 ) + + CAST ( NULL AS INTEGER ) + - + col2 + - col2 * - col1 * CAST ( NULL AS INTEGER ) + 69 >= ( 39 * + col0 + - col0 );
  - name: tab1

outputs:
  - name: q10061.out
    data: |
